import React from 'react';
import { Navigate, useNavigate } from 'react-router-dom';
import { Button } from 'reactstrap';

export default function ClubOrUser() {
  const navigate = useNavigate();
  return (
    <Button
      onClick={() => navigate('/')}
    >
      Регистрация как клуб
    </Button>
  );
}
